import { makeAutoObservable } from "mobx"

class Specifications {
     listHeight = []
     listWeight = []

     get heightList() {
        let list = []
        for (let i = 100; i<=200; i++){
            list =  [...list,i]
        }
        this.listHeight = list;
      }

     get weightList() {
        let list = []
        for (let i = 30; i<=150; i++){
            list =  [...list,i]
        }
        this.listWeight = list;
      }

    constructor() {
        makeAutoObservable(this)
    }



}

export default Specifications
